import React, {Component, Fragment} from "react";

class Product extends Component {
    render(){
        return(
            <Fragment>
                <div className="header">
                <div>3</div>
                </div>
                <hr />
                <p>Rp. 120000</p>
                <div>
                    <button>-</button>
                    <input type="text" value={3}/>
                    <button>+</button>
                </div>
            </Fragment>
        )
    }
}

export default Product;
